import * as React from 'react';

import { Card, CardMedia, CardContent, CardActionArea, CardHeader, Typography } from '@material-ui/core';

import Graduation from '../images/grad.jpg';

const Landing = (props) => {
  return (
    <div className='landing'>
      <div className='grid-2-h'>
        <div>
          <Typography variant='h2'>About me</Typography>
          <p>Hi, my name is John,(Populate with text describing me)</p>
        </div>
        <div className='landing-image-container'>
          <img className='landing-image' src={Graduation} alt='High School Graduation' />
        </div>
      </div>
    </div>
  );
}
export default Landing;
